const ImmigrationtoAustralia  = () => {
  return (
    
      <div className="australiaimmigrationcomponents">
        {" "}
        <img className='australiaimmigrationcomponentsimg' src={Australiaimmigration} width="320px" height="274px" ></img>{" "}
        <p className="australiaimmigrationcomponentsone">usaapplication </p>
        <p className='australiaimmigrationcomponentstwo'>Studying abroad is all about choosing the right destination, university and course. Read along some interesting articles to make the most of your international education experience. </p>
      </div>
    
  );
};

export default ImmigrationtoAustralia ;
